import PublicRoute from "../utils/PublicRoute.js";

const Work = () => {
  const content = (
    <>
      <svg height="250" width="500">
        <polygon
          points="220,10 300,210 170,250 123,234"
          style="fill:#d0491e;stroke:#128482;stroke-width:4"
        />
      </svg>
    </>
  );

  return <PublicRoute title="work" content={content} />;
};

export default Work;
